import React from 'react';
import { Button, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle, Box, Typography } from '@mui/material';
import { useNavigate } from 'react-router-dom';

interface Product {
  _id: string;
  BuyerName: string;
  SellerName: string;
  UnitPrice: number;
  TotalUnits: number;
  Tenure: number;
  DiscountRate: number;
  Xirr: number;
  ID: string;
}

interface OrderDetailsPopupProps {
  open: boolean;
  onClose: () => void;
  product: Product | null;
  units: number;
}

export const OrderDetailsPopup: React.FC<OrderDetailsPopupProps> = ({ open, onClose, product, units }) => {
  const navigate = useNavigate();

  const handleConfirmOrder = () => {
    // Handle the order confirmation logic
    // You can navigate to another page if necessary
    navigate('/some-route'); // Replace '/some-route' with your desired route
  };

  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>Order Details</DialogTitle>
      <DialogContent>
        <DialogContentText>
          Here are the details of your order:
        </DialogContentText>
        {product && (
          <Box>
            <Typography>Buyer Name: {product.BuyerName}</Typography>
            <Typography>Seller Name: {product.SellerName}</Typography>
            <Typography>Unit Price: â‚¹{product.UnitPrice}</Typography>
            <Typography>Total Units: {product.TotalUnits}</Typography>
            <Typography>Tenure: {product.Tenure} Days</Typography>
            <Typography>Discount Rate: {product.DiscountRate}</Typography>
            <Typography>XIRR: {product.Xirr}%</Typography>
            <Typography>Units Ordered: {units}</Typography>
          </Box>
        )}
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} color="primary">
          Close
        </Button>
        <Button
          onClick={handleConfirmOrder}
          sx={{
            textDecoration: 'none',
            '&:hover': { cursor: 'pointer', color: 'blue', backgroundColor: 'white' },
            backgroundColor: '#c0e5f2',
            m: 3
          }}
        >
          Confirm Order
        </Button>
      </DialogActions>
    </Dialog>
  );
};
